(298, 'https://www.nationalgeographic.com/animals/article/birds-moved-to-urban-areas-during-covid-lockdowns-anthropause', 'Birds flocked to cities during COVID-19, rapidly adapting to lockdowns', 'Some species quickly responded to lower levels of human activity, but whether their return to urban areas is good for them—or not—remains unclear.', '', 0),
(299, 'https://www.nationalgeographic.com/animals/article/highest-bee-diversity-on-earth-found-in-arizona-desert', 'This desert valley is home to 500 bee species, a world record', 'The San Bernardino Valley, straddling Arizona and Mexico, is a hot spot for bee diversity—but faces unknown impacts from border wall construction.', '', 0),
(300, 'https://www.nationalgeographic.com/animals/article/these-animals-offer-key-clues-for-environmental-change', 'These animals offer key clues for environmental change', 'Indicator species are often the first to be affected by change in an ecosystem. Studying these sensitive animals helps scientists detect the effects of climate change and pollution early.', '', 0),
(301, 'https://www.nationalgeographic.com/animals/article/why-beavers-were-parachuted-into-the-idaho-wilderness', 'Why beavers were parachuted into the Idaho wilderness 73 years ago', 'The traditional way of relocating “nuisance” beavers in the 1940s wasn’t working. To increase the survival rate, one conservation officer turned to—yes—parachutes.', '', 0),
(302, 'https://www.nationalgeographic.com/magazine/article/central-african-sanctuary-gives-hope-to-chimpsand-their-rescuers-feature', 'Central African sanctuary gives hope to chimps—and their rescuers', 'Saved from the chaos in that region, traumatized chimpanzees have become models of resilience for their human caretakers.', '', 0),
(303, 'https://www.nationalgeographic.com/animals/article/how-heavy-metals-give-spiders-and-other-tiny-animals-their-powerful-bite', 'How heavy metals give spiders and other tiny animals their powerful bite', 'Elements such as zinc and copper mix with natural proteins to make durable stingers, claws, and jaws, a new study says.', '', 0),
(304, 'https://www.nationalgeographic.com/animals/article/japans-controversial-annual-dolphin-hunt-begins', 'Japan’s controversial annual dolphin hunt begins', 'More than a decade after “The Cove” revealed the cruelty behind the practice, Taiji fishermen continue to round up dolphins to supply aquariums and marine parks.', '', 0),
