(308, 'https://www.nationalgeographic.com/animals/article/why-animal-shelters-are-facing-a-new-crisis', 'Why animal shelters are facing a new crisis', 'Across North America, staffing shortages and the pandemic make it a struggle to help homeless dogs, cats, and rabbits.', '', 0),
(309, 'https://www.nationalgeographic.com/animals/article/male-squid-help-choose-a-home-for-their-mate-first-ever-study-shows', 'Male squid help choose a home for their mate, first-ever study shows', 'Bigfin reef squid may engage in paternal care, a practice more often seen in monogamous vertebrates, such as birds.', '', 0),
(310, 'https://www.nationalgeographic.com/animals/article/good-news-for-tuna-populations-in-latest-iucn-update', 'These popular tuna species are no longer endangered, surprising scientists', 'From fish to Komodo dragons, the International Union for Conservation of Nature has updated its list of the world’s most endangered species.', '', 0),
(311, 'https://www.nationalgeographic.com/pages/topic/planet-possible', 'Planet Possible', 'Planet Possible is designed to inform, inspire, and empower all of us to live more lightly on the planet. ', '', 0),
(312, 'https://www.nationalgeographic.com/animals/article/franklins-bumblebee-listed-as-endangered', 'Bumblebee not seen since 2006 listed as endangered', 'Franklin’s bumblebee is only the second bumblebee to join the U.S. endangered species list, and the first from the American West.', '', 0),
(313, 'https://www.nationalgeographic.com/environment/article/why-electric-planes-will-be-the-next-great-challenge', 'Why electric planes will be the next great challenge', 'Airplane emissions from jet fuel usage are projected to climb as more and more planes enter the sky. A future without planes seems unimaginable, so we need to rethink how they fly. This could usher in the next wave of aviation driven by electric power.', '', 0),
(314, 'https://www.nationalgeographic.com/pages/topic/nat-geo-explores-video-series', 'Nat Geo Explores Video Series', 'From National Geographic Media, Nat Geo Explores breaks down the worlds of Science, History, and Animals. In each episode, scientists and historians explain in fascinating detail everything from the connection between germs and diseases to how we became obsessed with Mars.', '', 0),
(315, 'https://www.nationalgeographic.com/environment/article/is-the-us-becoming-more-bike-friendly', 'Is the U.S. becoming more bike friendly?', 'In many cities, the pandemic has reinforced a trend: They\'re building out the infrastructure needed to make cycling safe.', '', 0),
(316, 'https://www.nationalgeographic.com/environment/article/wildfires-threaten-the-worlds-oldest-trees-but-prescribed-burns-are-protecting-them', 'Wildfires threaten the world’s oldest trees—but prescribed burns are protecting them', 'Famous sequoias like the General Sherman are protected by a long history of intentionally set fires, but other giant sequoias are in big trouble.', '', 0),
(317, 'https://www.nationalgeographic.com/environment/article/jane-goodall-joins-campaign-to-plant-a-trillion-trees-by-2030', 'Jane Goodall joins campaign to plant a trillion trees by 2030', 'Trees for Jane will support efforts underway, mostly in the developing world, to replenish the earth\'s trees.', '', 0),
