(320, 'https://www.nationalgeographic.com/environment/article/paid-content-protecting-the-lifeline-of-the-okavango-delta', 'Protecting the lifeline of the Okavango Delta', 'At the heart of northern Botswana’s Kalahari Desert lies one of Africa’s most remarkable natural treasures, but changing circumstances are putting its future at risk.', '', 0),
(321, 'https://www.nationalgeographic.com/environment/article/pollution-and-overuse-threaten-floridas-fragile-freshwater-springs', 'Pollution and overuse threaten Florida\'s fragile freshwater springs', 'Declining flows, agricultural runoff, and sewage are pressuring the world’s largest network of freshwater springs.', '', 0),
(322, 'https://www.nationalgeographic.com/environment/article/hurricane-categories-do-not-tell-the-whole-story-see-what-matters', 'Hurricane categories don’t tell the whole story—here\'s what really matters', 'A hurricane doesn’t have to be a Category 5 to cause the most damage.', '', 0),
