(324, 'https://www.nationalgeographic.com/environment/article/see-the-beautiful-ecologically-priceless-trees-italy-is-protecting-forever', 'See the beautiful, ecologically priceless trees Italy is protecting forever', 'Dotted across Italy, 22,000 ancient trees have gained federal protection, making them cornerstones of cultural history.', '', 0),
(325, 'https://www.nationalgeographic.com/history/article/this-obscure-now-contentious-law-is-being-used-to-expel-thousands-of-migrants', 'This obscure, now contentious law is being used to expel thousands of migrants', 'Photos from the U.S.-Mexico border capture odyssey of Haitian migrants who returned to Mexico or are still waiting to cross.', '', 0),
